                    "link": "/Odontologia"
                },
                {
                    "id": 112,
                    "iImage": "dermatologia.png",
                    "text": "PAAP",
                    "link": "/Dermatologia"
                },
                {
                    "id": 113,
                    "iImage": "homeopata.png",
                    "text": "Talleres",
                    "link": "/Homeopatia"
